// Reports.jsx
import React, { useState, useEffect, useContext } from 'react';
import { ReportService } from '../../services/reportService';
import { LanguageContext } from '../../context/LanguageContext';

const Reports = () => {
  const { currentLanguage, translations } = useContext(LanguageContext);
  const t = translations[currentLanguage];

  const [reportType, setReportType] = useState('weekly');
  const [reportData, setReportData] = useState(null);
  const [reportDate, setReportDate] = useState(new Date().toISOString().split('T')[0]);
  const [loading, setLoading] = useState(false);

  const generateReport = () => {
    setLoading(true);
    try {
      const targetDate = new Date(reportDate);
      const report = ReportService.generateComprehensiveReport(reportType, targetDate);
      setReportData(report);
    } catch (error) {
      console.error('ÁîüÊàêÊä•ÂëäÂ§±Ë¥•:', error);
    } finally {
      setLoading(false);
    }
  };

  const downloadReport = () => {
    if (reportData) {
      ReportService.generateAndDownloadReport(reportType);
    }
  };

  // È°µÈù¢Âä†ËΩΩÊó∂ÁîüÊàêÈªòËÆ§Êä•Âëä
  useEffect(() => {
    generateReport();
  }, []);

  return (
    <div className="admin-page">
      <div className="page-header">
        <h1 className="page-title">Êï∞ÊçÆÊä•Âëä</h1>
        <p className="page-subtitle">Á≥ªÁªüËøêË°åÊï∞ÊçÆÁªüËÆ°‰∏éÂàÜÊûê</p>
      </div>

      <div className="card">
        <div className="card-header">
          <h3 className="card-title">Êä•ÂëäÈÖçÁΩÆ</h3>
        </div>
        <div className="card-body">
          <div className="form-row">
            <div className="form-group">
              <label className="form-label">Êä•ÂëäÁ±ªÂûã</label>
              <select 
                className="form-select"
                value={reportType} 
                onChange={(e) => setReportType(e.target.value)}
              >
                <option value="daily">Êó•Êä•</option>
                <option value="weekly">Âë®Êä•</option>
                <option value="monthly">ÊúàÊä•</option>
                <option value="quarterly">Â≠£Â∫¶Êä•Âëä</option>
              </select>
            </div>
            <div className="form-group">
              <label className="form-label">Êó∂Èó¥ËåÉÂõ¥</label>
              <input type="date" className="form-input" />
            </div>
            <div className="form-group">
              <button className="btn btn-primary" onClick={generateReport}>
                <span className="btn-icon">üìä</span>
                ÁîüÊàêÊä•Âëä
              </button>
            </div>
          </div>
        </div>
      </div>

      <div className="stats-grid">
        <div className="stat-card primary">
          <div className="stat-header">
            <div className="stat-info">
              <div className="stat-title">ÊÄªÂåπÈÖçÊï∞</div>
              <div className="stat-value">{reportData.totalMatches}</div>
            </div>
            <div className="stat-icon primary">ü§ù</div>
          </div>
          <div className="stat-change up">‚Üó ËæÉ‰∏äÊúàÂ¢ûÈïø 12%</div>
        </div>

        <div className="stat-card success">
          <div className="stat-header">
            <div className="stat-info">
              <div className="stat-title">Êñ∞Ê≥®ÂÜåÁî®Êà∑</div>
              <div className="stat-value">{reportData.newUsers}</div>
            </div>
            <div className="stat-icon success">üë•</div>
          </div>
          <div className="stat-change up">‚Üó ËæÉ‰∏äÊúàÂ¢ûÈïø 8%</div>
        </div>

        <div className="stat-card warning">
          <div className="stat-header">
            <div className="stat-info">
              <div className="stat-title">Ê¥ªË∑ÉËØ∑Ê±Ç</div>
              <div className="stat-value">{reportData.activeRequests}</div>
            </div>
            <div className="stat-icon warning">üìã</div>
          </div>
          <div className="stat-change up">‚Üó ËæÉ‰∏äÊúàÂ¢ûÈïø 15%</div>
        </div>

        <div className="stat-card info">
          <div className="stat-header">
            <div className="stat-info">
              <div className="stat-title">ÂÆåÊàêÁéá</div>
              <div className="stat-value">{reportData.completionRate}</div>
            </div>
            <div className="stat-icon info">‚úÖ</div>
          </div>
          <div className="stat-change up">‚Üó ËæÉ‰∏äÊúàÂ¢ûÈïø 5%</div>
        </div>
      </div>

      <div className="card">
        <div className="card-header">
          <h3 className="card-title">Ë∂ãÂäøÂõæË°®</h3>
        </div>
        <div className="card-body">
          <div className="chart-placeholder">
            <div className="chart-icon">üìà</div>
            <div className="chart-title">Êï∞ÊçÆÂèØËßÜÂåñÂõæË°®</div>
            <p className="chart-description">
              ËøôÈáåÂ∞ÜÊòæÁ§∫ {reportType} ÁöÑÊï∞ÊçÆË∂ãÂäøÂõæË°®
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Reports;
